import {Link} from 'react-router-dom';
import {FaHome} from 'react-icons/fa';
import {MdComputer} from 'react-icons/md';
import {GiCircuitry,GiPowerLightning} from 'react-icons/gi';
import {FcElectricity} from 'react-icons/fc';

function Navmenu(){
    return (
        <div>
            <nav>
                <li>
                    <Link to='/' ><FaHome/></Link>
                </li>
                <li>
                    <Link to='/civil-page' ></Link>
                </li>
                <li>
                    <Link to='/eee-page' ><GiPowerLightning /></Link>
                </li>
                <li>
                    <Link to='/mech-page' ></Link>
                </li>
                <li>
                    <Link to='/ece-page' ><GiCircuitry /></Link>
                </li>
                <li>
                    <Link to='/cse-page' ><MdComputer /></Link>
                </li>
            </nav>
        </div>
    );
}
export default Navmenu;
